    "2016-04-19T02:28:37.652402",nt"name": "austin-energy-customer-data-by-customer-class",nt"isopen":
    false,nt"url": null,nt"notes": "Austin Energy has four main customer classes:
    residential, commercial, industrial, and other. rnrnResidential customers live in
    single-family dwellings, mobile homes, townhouses, or individually metered apartment
    units. rnrnThe majority of commercial customers are small to large businesses that
    fall under Austin Energyu2019s secondary level of service. This means Austin Energy
    owns, operates, and maintains the equipment (wires, transformers, etc.) supplying
    power to those facilities. rnrnIndustrial (Primary) customers take service at high
    voltage (12,500 volts or higher) and own, operate and maintain their own equipment.
    Consequently, Austin Energy experiences lower overall system losses and it costs
    less to serve these customers. Large commercial and industrial customers such as
    semiconductors, high-tech facilities, and data centers typically fall under the
    primary level of service. These customers have very high usage and load factors
    because they tend to operate 24/7. rnrnThe final class, other, typically refers
    to street lighting and facilities such as ballparks.",nt"license_title": "License
